import React, { useState } from 'react';
const Modal = ({ isOpen, onClose, isLoggedIn, onLogout }) => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');


    const handleUsernameChange = (e) => {
        setUsername(e.target.value);
    };

    const handlePasswordChange = (e) => {
        setPassword(e.target.value);
    };

    function getCookie(name) {
        const value = `; ${document.cookie}`;
        const parts = value.split(`; ${name}=`);
        if (parts.length === 2) {
            return parts.pop().split(';').shift();
        }
    }

    const handleSubmit = async (e) => {
        e.preventDefault();
        // Perform  login logic here
        const credentials = {
            username: username,
            password: password
        }

        try {
            const response = await fetch('http://127.0.0.1:8000/api/login/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'X-CSRFToken': getCookie('csrftoken') // CSRF v;delem
                },
                body: JSON.stringify(credentials)
            });

            const data = await response.json();

            if (data.status === 'success') {

                isOpen = false;
                localStorage.setItem('username', username);

                try {
                    const response = await fetch('http://127.0.0.1:8000/api/level/', {
                        method: 'POST',
                        headers: {
                            'Content-Type': 'application/json',
                            'X-CSRFToken': getCookie('csrftoken') // using CSRF protection
                        },
                        body: JSON.stringify({ username: username })
                    });

                    const data = await response.json();

                    if (data.status === 'success' && data.levelAt) {
                        alert('Login successful!');

                        window.location.href = data.levelAt;



                    } else {
                        alert("Something ain't right.");
                    }
                } catch (error) {
                    console.error(error);
                }

            } else if (data.status === 'error') {
                // Handle error case
                alert(data.message);
            }
        } catch (error) {
            console.error(error);
        }

        // You can make an API request or handle it in any way you prefer

        console.log('Username:', username);
        console.log('Password:', password);
        // Reset the form
        //setPassword('');
    };

    const handleLogout = async (e) => {
        e.preventDefault();   

        try {
            const response = await fetch('http://127.0.0.1:8000/api/logout/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    //'X-CSRFToken': getCookie('csrftoken') // using CSRF protection
                },
                body: JSON.stringify({ username: localStorage.getItem('username') })
            });

            const data = await response.json();

            if (data.status === 'success') {
                alert('Logout successful!');
                localStorage.setItem('username', '');
                window.location.href = "/";



            } else {
                alert("Something ain't right.");
            }
        } catch (error) {
            console.error(error);
        }

        //localStorage.setItem('username', '');
        //window.location.href = "/";

    };

    const handleChangePasword = async (e) => {
        e.preventDefault();
        window.location.href = "/changepassword";
    }
    const name = localStorage.getItem('username');

    if (isLoggedIn) { 


        return (
            <>
                {isOpen && (
                    <div className="modal">
                        <div className="modal delayed">
                            <button className="modal-button-style-small-left" onClick={onClose}>Close</button>
                            <div className="modal-content">
                                <h2>LOGOUT</h2>
                                <form onLogout={handleLogout}>
                                    <label>
                                        LOGGED IN AS: <span>{name}</span>
                                    </label>
                                    <button className="modal-button-style-small" onClick={handleLogout}>Logout</button>

                                </form>
                                <button className="modal-button-style-small-chgpswd" onClick={handleChangePasword}>CHANGE PASSWORD</button>

                            </div>
                        </div>

                    </div>
                )}
            </>
        );
    }

    return (
        <>
            {isOpen && (
                <div className="modal">
                    <div className="modal delayed">
                        <button className="modal-button-style-small-left" onClick={onClose}>CLOSE</button>
                        <div className="modal-content">
                            <h2>LOGIN</h2>
                            <form onSubmit={handleSubmit}>
                                <label>
                                    USERNAME
                                    <input type="text" className= "modal-login-input" value={username} onChange={handleUsernameChange} />
                                </label>
                                <label>
                                    PASSWORD
                                    <input type="password" className="modal-login-input" value={password} onChange={handlePasswordChange} />
                                </label>                          
                                <button className="modal-button-style-small" type="submit">Login</button>
                            </form> 

                        </div>
                    </div>

                </div>
            )}
        </>
    );
};

export default Modal;
